import React, { useEffect } from 'react';

export default function Signup() {
	useEffect(() => {
		window.scrollTo(0, 0);
	}, []);

	return (
		<div>
			<h1 className='sign-up' id='sign-up'>
				BOOKING
			</h1>
		</div>
	);
}
